/**
=========================================================
* Soft UI Dashboard PRO React - v2.0.0
=========================================================

* Product Page: https://www.creative-tim.com/product/soft-ui-dashboard-pro-material-ui
* Copyright 2021 Creative Tim (https://www.creative-tim.com)

Coded by www.creative-tim.com

 =========================================================

* The above copyright notice and this permission notice shall be included in all copies or substantial portions of the Software.
*/

// @mui material components
import Grid from "@mui/material/Grid";
import Card from "@mui/material/Card";

// Soft UI Dashboard PRO React components
import SuiBox from "components/SuiBox";
import SuiTypography from "components/SuiTypography";
import SuiInput from "components/SuiInput";
import SuiButton from "components/SuiButton";

// Soft UI Dashboard PRO React example components
import DefaultNavbar from "examples/Navbars/DefaultNavbar";
import PageLayout from "examples/LayoutContainers/PageLayout";
import SpaceShip from "examples/Icons/SpaceShip";

// Soft UI Dashboard PRO React page layout routes
import pageRoutes from "pageRoutes";

// Images
import curved9 from "assets/images/curved-images/curved9.jpg";

function Basic() {
  return (
    <PageLayout>
      <DefaultNavbar
        routes={pageRoutes}
        action={{
          type: "external",
          route: "https://www.creative-tim.com",
          label: "buy nowss",
        }}
        transparent
        light
      />
      <SuiBox position="relative" width="100vw" height="100vh" customClass="overflow-hidden">
        <SuiBox
          // component="img"
          // src={curved9}
          // alt="background-image"
          // position="absolute"
          // width="100%"
          // height="100%"
          // customClass="object-cover object-center"
        />
        <SuiBox
          position="absolute"
          width="100%"
          height="100%"
          backgroundColor="dark"
          backgroundGradient
          opacity={0.6}
        />
        <Grid container spacing={3} justifyContent="center" alignItems="center" className="h-100">
          <Grid item xs={11} md={6} lg={3}>
            <Card>
              <SuiBox textAlign="center" p={6}>
                <SuiBox
                  display="grid"
                  justifyContent="center"
                  alignItems="center"
                  width="6.25rem"
                  height="6.25rem"
                  borderRadius="50%"
                  boxShadow="regular"
                  fontSize="3rem"
                  color="white"
                  backgroundColor="warning"
                  backgroundGradient
                  mx="auto"
                  mb={3}
                >
                  <SpaceShip color="white" size="35px" />
                </SuiBox>
                <SuiBox mb={3} px={1}>
                  <SuiTypography variant="h2" fontWeight="bold">
                    2-Step Verification
                  </SuiTypography>
                </SuiBox>
                <SuiBox mb={2}>
                  <Grid container spacing={2}>
                    <Grid item xs>
                      <SuiInput size="large" inputProps={{ maxLength: 1 }} />
                    </Grid>
                    <Grid item xs>
                      <SuiInput size="large" inputProps={{ maxLength: 1 }} />
                    </Grid>
                    <Grid item xs>
                      <SuiInput size="large" inputProps={{ maxLength: 1 }} />
                    </Grid>
                    <Grid item xs>
                      <SuiInput size="large" inputProps={{ maxLength: 1 }} />
                    </Grid>
                  </Grid>
                </SuiBox>
                <SuiBox mb={2}>
                  <SuiButton variant="gradient" buttonColor="warning" fullWidth>
                    send code
                  </SuiButton>
                </SuiBox>
                <SuiTypography variant="button" textColor="text" fontWeight="regular">
                  Haven&apos;t received it?{" "}
                  <a href="#verification" className="link">
                    Resend a new code
                  </a>
                  .
                </SuiTypography>
              </SuiBox>
            </Card>
          </Grid>
        </Grid>
      </SuiBox>
    </PageLayout>
  );
}

export default Basic;
